import React, { useEffect, useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Search, Bell, Home, Shield,
  Clock, CheckCircle, Star, BarChart3
} from 'lucide-react';
import './Auth.css';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [stats, setStats] = useState([]);
  const [activities, setActivities] = useState([]);
  const [notifications, setNotifications] = useState([
    { id: 1, title: 'Welcome!', message: 'Your account has been created successfully', time: '2 min ago', unread: true },
    { id: 2, title: 'Profile Update', message: 'Complete your profile to unlock all features', time: '1 hour ago', unread: true },
    { id: 3, title: 'Security Alert', message: 'New login from Windows PC', time: '2 hours ago', unread: false }
  ]);
  const [showNotifications, setShowNotifications] = useState(false);
  const [showUserMenu, setShowUserMenu] = useState(false);
  const navigate = useNavigate();

  const notifRef = useRef(null);
  const userMenuRef = useRef(null);

  // Close dropdowns on outside click
  useEffect(() => {
    const handleClickOutside = (e) => {
      if (notifRef.current && !notifRef.current.contains(e.target)) {
        setShowNotifications(false);
      }
      if (userMenuRef.current && !userMenuRef.current.contains(e.target)) {
        setShowUserMenu(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);

  // Auth check
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
      return;
    }

    fetch("http://localhost:5000/api/user/me", {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => {
        if (!res.ok) throw new Error("Unauthorized");
        return res.json();
      })
      .then(data => setUser(data))
      .catch(() => {
        localStorage.clear();
        navigate("/login");
      });
  }, [navigate]);

  // Stats
  useEffect(() => {
    fetch("http://localhost:5000/api/dashboard/activity", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` }
    })
      .then(res => res.json())
      .then(data => {
        setStats([
          { icon: <BarChart3 />, value: data.totalActivities, label: 'Total Activities', change: '+12%', color: '#6366f1' },
          { icon: <Clock />, value: data.activeTime, label: 'Active Time', change: '+5%', color: '#8b5cf6' },
          { icon: <CheckCircle />, value: data.completed, label: 'Completed Tasks', change: '+8%', color: '#06b6d4' },
          { icon: <Star />, value: data.successRate, label: 'Success Rate', change: '+2%', color: '#10b981' }
        ]);
      });
  }, []);

  // Activity
  useEffect(() => {
    fetch("http://localhost:5000/api/dashboard/activity", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` }
    })
      .then(res => res.json())
      .then(data => setActivities(data));
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  const markAsRead = (id) => {
    setNotifications(prev =>
      prev.map(n => n.id === id ? { ...n, unread: false } : n)
    );
  };

  const unreadCount = notifications.filter(n => n.unread).length;

  if (!user) {
    return (
      <div className="loading-screen">
        <div className="loading-spinner"></div>
        <p>Loading your dashboard...</p>
      </div>
    );
  }

  return (
    <div className="dashboard">
      {/* NAVBAR */}
      <nav className="navbar">
        <div className="nav-left">
          <div className="brand-logo-sm">
            <Shield size={24} />
            <span>Authra</span>
          </div>
        </div>

        <div className="nav-center">
          <div className="search-box">
            <Search size={18} />
            <input type="text" placeholder="Search..." />
          </div>
        </div>

        <div className="nav-right">
          <button className="icon-btn"><Home size={20} /></button>

          {/* Notifications */}
          <div className="notification-wrapper" ref={notifRef}>
            <button className="icon-btn" onClick={() => setShowNotifications(!showNotifications)}>
              <Bell size={20} />
              {unreadCount > 0 && <span className="badge">{unreadCount}</span>}
            </button>

            {showNotifications && (
              <div className="dropdown notification-dropdown">
                <div className="dropdown-header">
                  <h3>Notifications</h3>
                  <button onClick={() => setNotifications([])}>Clear all</button>
                </div>
                <div className="notification-list">
                  {notifications.length > 0 ? (
                    notifications.map(n => (
                      <div key={n.id} className={`notification-item ${n.unread ? 'unread' : ''}`}
                        onClick={() => markAsRead(n.id)}>
                        <div className="notification-content">
                          <h4>{n.title}</h4>
                          <p>{n.message}</p>
                          <span className="time">{n.time}</span>
                        </div>
                        {n.unread && <div className="unread-dot"></div>}
                      </div>
                    ))
                  ) : (
                    <div className="no-notifications">
                      <span style={{ fontSize: '48px' }}>üì≠</span>
                      <p>No notifications</p>
                    </div>
                  )}
                </div>
              </div>
            )}
          </div>

          {/* USER MENU */}
          <div className="user-menu-wrapper" ref={userMenuRef}>
            <div className="user-avatar" onClick={() => setShowUserMenu(!showUserMenu)}>
              {user?.name?.charAt(0) || 'A'}
            </div>

            {showUserMenu && (
              <div className="user-dropdown">
                <div className="user-dropdown-header">
                  <div className="avatar-sm">{user?.name?.charAt(0)}</div>
                  <div>
                    <strong>{user.name}</strong>
                    <p>{user.email}</p>
                  </div>
                </div>

                <div className="user-dropdown-body">
                  <div className="action-card" onClick={() => navigate('/settings')}>
                    <h4>Settings</h4>
                    <p>Manage your account preferences</p>
                  </div>
                  <div className="action-card" onClick={handleLogout}>
                    <h4>Logout</h4>
                    <p>Sign out from your account</p>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </nav>

      {/* CONTENT */}
      <div className="dashboard-content">
        <div className="welcome-banner">
          <div className="banner-text">
            <h1>Welcome back, {user?.name?.split(' ')[0] || 'User'}!</h1>
            <p>Here's what's happening with your account today</p>
          </div>
          <div className="user-info">
  <div className="info-item">
    <span className="label">Email</span>
    <span className="value">{user.email}</span>
  </div>
  <div className="info-item">
    <span className="label">Role</span>
    <span className="value">{user.role || "User"}</span>
  </div>
  <div className="info-item">
    <span className="label">Status</span>
    <span className="value">Active</span>
  </div>
</div>

        </div>

        <div className="stats-grid">
          {stats.map((s, i) => (
            <div key={i} className="stat-card">
              <div className="stat-icon" style={{ backgroundColor: s.color }}>{s.icon}</div>
              <div className="stat-info">
                <h3>{s.value}</h3>
                <p>{s.label}</p>
                <span className="change positive">{s.change} this week</span>
              </div>
            </div>
          ))}
        </div>
        <div className="features-grid">
  <div className="feature-card">
    <div className="feature-icon">üë§</div>
    <div className="feature-content">
      <h3>Profile</h3>
      <p>Edit your profile details</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-icon">üîê</div>
    <div className="feature-content">
      <h3>Security</h3>
      <p>Change password & settings</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-icon">üìä</div>
    <div className="feature-content">
      <h3>Reports</h3>
      <p>View activity reports</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-icon">‚öôÔ∏è</div>
    <div className="feature-content">
      <h3>Settings</h3>
      <p>Manage preferences</p>
    </div>
  </div>
</div>


        <div className="activity-section">
          <div className="section-header">
            <h2>Recent Activity</h2>
          </div>
          <div className="activity-list">
            {activities.map(a => (
              <div key={a.id} className="activity-item">
                <div className="activity-content">
                  <h4>{a.title}</h4>
                  <p>{a.desc}</p>
                  <span className="time">{a.time}</span>
                </div>
                
              </div>
            ))}
            {/* Feature Shortcuts */}
<div className="features-grid">
  <div className="feature-card">
    <div className="feature-content">
      <h3>üìÅ File Manager</h3>
      <p>Upload and manage your files</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-content">
      <h3>üßæ Activity Logs</h3>
      <p>View detailed user activities</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-content">
      <h3>üõ° Security Center</h3>
      <p>Manage security and sessions</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-content">
      <h3>üìà Analytics</h3>
      <p>View usage and performance</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-content">
      <h3>üí¨ Messages</h3>
      <p>Check your messages</p>
    </div>
  </div>

  <div className="feature-card">
    <div className="feature-content">
      <h3>üßë‚Äçü§ù‚Äçüßë Team Members</h3>
      <p>Manage your team</p>
    </div>
  </div>
</div>

          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
